          </div>
          <div>
            <img src="https://upload.wikimedia.org/wikipedia/commons/5/5d/Tyrannosaurus_Sue.jpg" alt="Image 3" />
            <p className="legend">Legend 3</p>
          </div>
            </div>

        )
    }
}
